import closeButton from '../images/close-button.svg';

import image from '../images/register-succes.svg';

function InfoTooltip() {
  
    return (
        <article
        className="popup popup_opened">
        <div className="popup__container">
            <div className="tooltip__container">
        <button className="popup__close-button" type="button">
            <img className="popup__image-close" src={closeButton} alt="закрыть попап"/>
        </button>
        <img className="tooltip__image" src={image} />
        <h2 className="tooltip__title">Вы успешно зарегистрировались!</h2>
        </div>
        </div>
    </article>
)}

export default InfoTooltip;
